" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Picture showing large joint involvement of patient with nephrogenic system fibrosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with nephrogenic systemic fibrosis can have involvement of large joints. The knees pictured here are in a permanently flexed position, making walking and standing impossible. In addition, there is brownish mottling of the skin.",
"    <div class=\"footnotes\">",
"    </div>",
