var title_f27_44_28360="Relative risks of the main complications of CKD";
var content_f27_44_28360=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F58089&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F58089&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 648px\">",
"   <div class=\"ttl\">",
"    Relative risks of major complications of chronic kidney disease based upon a continuous meta-analysis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 628px; height: 398px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Summary of continuous meta-analysis (adjusted relative risk (RR)) for general population cohorts with albumin-to-creatinine ratio (ACR). Mortality is reported for general population cohorts assessing albuminuria as urine ACR. Kidney outcomes are reported for general population cohorts assessing albuminuria as either urine ACR or dipstick. Estimated glomerular filtration rate (eGFR) is expressed as a continuous variable. The three lines represent urine ACR of &lt;30 mg/g or dipstick negative and trace (blue), urine ACR 30-299 mg/g or dipstick 1+ positive (green), and urine ACR &gt;300 mg/g or dipstick &gt;2+ positive (red). All results are adjusted for covariates and compared with reference point of eGFR of 95 mL/min per 1.73 m",
"    <sup>",
"     2",
"    </sup>",
"    and ACR of &lt;30 mg/g or dipstick negative (diamond). Each point represents the pooled relative risk from a meta-analysis. Solid circles indicate statistical significance compared with the reference point (p&lt;0.05); triangles indicate non-significance. Red arrows indicate eGFR of 60 mL/min per 1.73 m",
"    <sup>",
"     2",
"    </sup>",
"    , threshold value of eGFR for the current definition of chronic kidney disease (CKD).",
"    <div class=\"footnotes\">",
"     HR: hazards ratio; OR: odds ratio.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by Permission from Macmillan Publishers Ltd: Levey AS, de Jong PE, Coresh J, et al. The definition, classification, and prognosis of chronic kidney disease: a KDIGO Controversies Conference report. Kidney Int 2010; 80:17. Copyright &copy; 2010.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
