var title_f27_44_28363="Classification system of drug-induced acute pancreatitis";
var content_f27_44_28363=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F60555&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F60555&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification system of drug-induced acute pancreatitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class Ia drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least 1 case report with positive rechallenge, excluding all other causes, such as alcohol, hypertriglyceridemia, gallstones, and other drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class Ib drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least 1 case report with positive rechallenge; however, other causes, such as alcohol, hypertriglyceridemia, gallstones, and other drugs were not ruled out",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class II drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least 4 cases in the literature",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consistent latency (&ge;75 percent of cases)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class III drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least 2 cases in the literature",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No consistent latency among cases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No rechallenge",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IV drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drugs not fitting into the earlier-described classes, single case report published in medical literature, without rechallenge",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Badalov N, Baradarian R, Kadirawel I, et al. Drug-Induced Acute Pancreatitis: An Evidence-Based Review. Clin Gastroenterol Hepatol 2007; 5:648. Copyright &copy; 2007 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
